using Html2Word.Models;
using System;
using System.IO;
using System.Net;
using System.Net.Http;
using System.Net.Http.Headers;
using System.Web.Http;

namespace Html2Word.Controllers
{
    public class DocumentController : ApiController
    {
        /// <summary>
        /// The entrance to the API to get the actual file.
        /// </summary>
        /// <returns></returns>
        [HttpGet]
        public HttpResponseMessage Generate()
        {
            var html = @"<html><body><h1>ORGANIZATION</h1><h2>Algemeen</h2><img src=""data:image/png;base64,""/><p>Dit is een organization die dingen doet.</p><h2>Tabellen uitleg</h2><h3>tbl_Organization</h3><table border=""1""><tr><td rowspan=""5""><img src=""""/></td></tr><tr><td><p class=""column-name"">OrganizationId</p><p class=""column-body"">De main identifier van de tabel.</p></td></tr><tr><td><p class=""column-name"">Test</p><p class=""column-body"">Dit is een andere kolom</p></td></tr><tr><td><p class=""column-name"">UserNameModified</p><p class=""column-body"">De user die dit record voor het laatst heeft gewijzigd.</p></td></tr><tr><td><p class=""column-name"">TransStartDate</p><p class=""column-body"">De datum wanneer het record voor het laatst is gewijzigd.</p></td></tr></table></body></html>";

            try
            {
                var document = new WordDocument();
                document.CreateDocument(html);
                return GetFile(document.FilePath);
            }
            catch(ArgumentException ex)
            {
                return Request.CreateResponse(HttpStatusCode.BadRequest, ex.Message);
            }
        }

        /// <summary>
        /// Get the actual file download.
        /// </summary>
        /// <param name="filePath">The path to save the temp docx.</param>
        /// <returns></returns>
        private HttpResponseMessage GetFile(string filePath)
        {
            var fileName = System.IO.Path.GetFileName(filePath);

            var response = new HttpResponseMessage(HttpStatusCode.OK)
            {
                Content = new StreamContent(new FileStream(filePath, FileMode.Open, FileAccess.Read))
            };
            response.Content.Headers.ContentDisposition = new System.Net.Http.Headers.ContentDispositionHeaderValue("attachment");
            response.Content.Headers.ContentDisposition.FileName = fileName;
            response.Content.Headers.ContentType = new MediaTypeHeaderValue("application/msword");

            return response;
        }
    }
}
